import{_ as e,c as s,o as a,a as n}from"./app.d5c63f3f.js";const y=JSON.parse('{"title":"React \u5165\u95E8\u5B66\u4E60\uFF08\u56DB\uFF09-- diffing \u7B97\u6CD5","description":"diff \u7B97\u6CD5\u662F React \u63D0\u5347\u6E32\u67D3\u6027\u80FD\u7684\u4E00\u79CD\u4F18\u5316\u7B97\u6CD5\uFF0C\u5728 React \u4E2D\u6709\u7740\u5F88\u91CD\u8981\u7684\u5730\u4F4D\u3002","frontmatter":{"title":"React \u5165\u95E8\u5B66\u4E60\uFF08\u56DB\uFF09-- diffing \u7B97\u6CD5","date":"2021-08-24T17:14:09.000Z","id":1635581649,"tags":["react","diffing\u7B97\u6CD5"],"categories":["React\u5165\u95E8\u5B66\u4E60"],"keywords":"react,diff,\u5C0F\u4E1E\u540C\u5B66","description":"diff \u7B97\u6CD5\u662F React \u63D0\u5347\u6E32\u67D3\u6027\u80FD\u7684\u4E00\u79CD\u4F18\u5316\u7B97\u6CD5\uFF0C\u5728 React \u4E2D\u6709\u7740\u5F88\u91CD\u8981\u7684\u5730\u4F4D\u3002"},"headers":[{"level":2,"title":"\u524D\u8A00","slug":"\u524D\u8A00"},{"level":2,"title":"\u4EC0\u4E48\u662F\u865A\u62DF DOM \uFF1F","slug":"\u4EC0\u4E48\u662F\u865A\u62DF-dom-\uFF1F"},{"level":2,"title":"\u4EC0\u4E48\u662F diff \u7B97\u6CD5\uFF1F","slug":"\u4EC0\u4E48\u662F-diff-\u7B97\u6CD5\uFF1F"},{"level":2,"title":"\u4E09\u4E2A\u7B56\u7565","slug":"\u4E09\u4E2A\u7B56\u7565"},{"level":3,"title":"tree diff \u5206\u5C42\u6C42\u5F02","slug":"tree-diff-\u5206\u5C42\u6C42\u5F02"},{"level":3,"title":"component diff","slug":"component-diff"},{"level":3,"title":"element diff","slug":"element-diff"},{"level":2,"title":"\u5EFA\u8BAE","slug":"\u5EFA\u8BAE"},{"level":2,"title":"\u53C2\u8003\u8D44\u6599","slug":"\u53C2\u8003\u8D44\u6599"}],"relativePath":"pages/react/primary/diff.md"}'),o={name:"pages/react/primary/diff.md"},p=n(`<p><img src="https://ljcimg.oss-cn-beijing.aliyuncs.com/img/diffing.png" alt="diffing"></p><blockquote><p>\u{1F4E2} \u5927\u5BB6\u597D\uFF0C\u6211\u662F\u5C0F\u4E1E\u540C\u5B66\uFF0C\u4E00\u540D<div color="#2e86de">\u51C6\u5927\u4E8C\u7684\u524D\u7AEF\u7231\u597D\u8005</div></p><p>\u{1F4E2} \u8FD9\u7BC7\u6587\u7AE0\u5C06<strong>\u5C3D\u529B</strong>\u8BF4\u660E\u767D <strong>diff \u7B97\u6CD5</strong></p><p>\u{1F4E2} <div color="#f368e0"><strong>\u613F\u4F60\u5FE0\u4E8E\u81EA\u5DF1\uFF0C\u70ED\u7231\u751F\u6D3B</strong></div></p></blockquote><h2 id="\u524D\u8A00" tabindex="-1">\u524D\u8A00 <a class="header-anchor" href="#\u524D\u8A00" aria-hidden="true">#</a></h2><p>diff \u7B97\u6CD5\u662F React \u63D0\u5347\u6E32\u67D3\u6027\u80FD\u7684\u4E00\u79CD\u4F18\u5316\u7B97\u6CD5\uFF0C\u5728 React \u4E2D\u6709\u7740\u5F88\u91CD\u8981\u7684\u5730\u4F4D\uFF0C\u4E5F\u4E0D\u6B62\u4E8E React \uFF0C\u5728 Vue \u4E2D\u4E5F\u6709 diff \u7B97\u6CD5\uFF0C\u4F3C\u4E4E\u6CA1\u6709\u5DEE\u522B\u3002\u5728\u6700\u8FD1\u7684 React \u5B66\u4E60\u4E2D\uFF0C\u5B66\u5230\u4E86 diff \u7B97\u6CD5\uFF0C\u611F\u89C9\u89C6\u9891\u4E2D\u7684\u5185\u5BB9\u6709\u70B9\u6D45\uFF0C\u5BF9 diff \u7B97\u6CD5\u4E0D\u591F\u6DF1\u5165\uFF0C\u56E0\u6B64\u60F3\u8981\u6DF1\u5165\u7684\u4E86\u89E3\u4EE5\u4E0B diff \u7B97\u6CD5\u3002\u4E8E\u662F\u5728\u6398\u91D1\uFF0C\u77E5\u4E4E\uFF0CCSDN \u7B49\u5E73\u53F0\u4E0A\uFF0C\u770B\u4E86\u5927\u91CF\u7684\u535A\u5BA2\uFF0C\u90FD\u975E\u5E38\u5730\u4E0D\u9519\uFF0C\u53EF\u60DC\u770B\u4E0D\u660E\u767D\uFF0Cwwww\u3002\u6240\u4EE5\u8FD9\u7BC7\u6587\u7AE0\u53EA\u662F\u81EA\u5DF1\u5BF9\u4E8E diff \u7B97\u6CD5\u7684\u4E00\u70B9\u7406\u89E3\uFF0C\u6709\u4EC0\u4E48\u95EE\u9898\u6216\u8005\u9519\u8BEF\u7684\u5730\u65B9\uFF0C\u5927\u5BB6<strong>\u4E00\u5B9A\u8981\u6307\u51FA</strong>\uFF01</p><h2 id="\u4EC0\u4E48\u662F\u865A\u62DF-dom-\uFF1F" tabindex="-1">\u4EC0\u4E48\u662F\u865A\u62DF DOM \uFF1F <a class="header-anchor" href="#\u4EC0\u4E48\u662F\u865A\u62DF-dom-\uFF1F" aria-hidden="true">#</a></h2><p>\u5728\u8C08 diff \u7B97\u6CD5\u4E4B\u524D\uFF0C\u6211\u4EEC\u9700\u8981\u5148\u4E86\u89E3\u865A\u62DF DOM \u3002\u5B83\u662F\u4E00\u79CD\u7F16\u7A0B\u6982\u5FF5\uFF0C\u5728\u8FD9\u4E2A\u6982\u5FF5\u91CC\uFF0C\u4EE5\u4E00\u79CD\u865A\u62DF\u7684\u8868\u73B0\u5F62\u5F0F\u88AB\u4FDD\u5B58\u5728\u5185\u5B58\u4E2D\u3002\u5728 React \u4E2D\uFF0Crender \u6267\u884C\u7684\u7ED3\u679C\u5F97\u5230\u7684\u5E76\u4E0D\u662F\u771F\u6B63\u7684 DOM \u8282\u70B9\uFF0C\u800C\u662F JavaScript \u5BF9\u8C61</p><blockquote><p>\u865A\u62DF DOM \u53EA\u4FDD\u7559\u4E86\u771F\u5B9E DOM \u8282\u70B9\u7684\u4E00\u4E9B<strong>\u57FA\u672C\u5C5E\u6027\uFF0C\u548C\u8282\u70B9\u4E4B\u95F4\u7684\u5C42\u6B21\u5173\u7CFB</strong>\uFF0C\u5B83\u76F8\u5F53\u4E8E\u5EFA\u7ACB\u5728 JavaScript \u548C DOM \u4E4B\u95F4\u7684\u4E00\u5C42\u201C\u7F13\u5B58\u201D</p></blockquote><div class="language-html"><span class="copy"></span><pre><code><span class="line"><span style="color:#89DDFF;">&lt;</span><span style="color:#F07178;">div</span><span style="color:#89DDFF;"> </span><span style="color:#C792EA;">class</span><span style="color:#89DDFF;">=</span><span style="color:#89DDFF;">&quot;</span><span style="color:#C3E88D;">hello</span><span style="color:#89DDFF;">&quot;</span><span style="color:#89DDFF;">&gt;</span></span>
<span class="line"><span style="color:#A6ACCD;">    </span><span style="color:#89DDFF;">&lt;</span><span style="color:#F07178;">span</span><span style="color:#89DDFF;">&gt;</span><span style="color:#A6ACCD;">hello world!</span><span style="color:#89DDFF;">&lt;/</span><span style="color:#F07178;">span</span><span style="color:#89DDFF;">&gt;</span></span>
<span class="line"><span style="color:#89DDFF;">&lt;/</span><span style="color:#F07178;">div</span><span style="color:#89DDFF;">&gt;</span></span>
<span class="line"></span></code></pre></div><p>\u4E0A\u9762\u7684\u8FD9\u6BB5\u4EE3\u7801\u4F1A\u8F6C\u5316\u53EF\u4EE5\u8F6C\u5316\u4E3A\u865A\u62DF DOM \u7ED3\u6784</p><div class="language-json"><span class="copy"></span><pre><code><span class="line"><span style="color:#89DDFF;">{</span></span>
<span class="line"><span style="color:#A6ACCD;">    tag</span><span style="color:#89DDFF;">:</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">&quot;</span><span style="color:#C3E88D;">div</span><span style="color:#89DDFF;">&quot;</span><span style="color:#89DDFF;">,</span></span>
<span class="line"><span style="color:#A6ACCD;">    props</span><span style="color:#89DDFF;">:</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">{</span></span>
<span class="line"><span style="color:#A6ACCD;">        class</span><span style="color:#89DDFF;">:</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">&quot;</span><span style="color:#C3E88D;">hello</span><span style="color:#89DDFF;">&quot;</span></span>
<span class="line"><span style="color:#A6ACCD;">    </span><span style="color:#89DDFF;">},</span></span>
<span class="line"><span style="color:#A6ACCD;">    children</span><span style="color:#89DDFF;">:</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">[{</span></span>
<span class="line"><span style="color:#A6ACCD;">        tag</span><span style="color:#89DDFF;">:</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">&quot;</span><span style="color:#C3E88D;">span</span><span style="color:#89DDFF;">&quot;</span><span style="color:#89DDFF;">,</span></span>
<span class="line"><span style="color:#A6ACCD;">        props</span><span style="color:#89DDFF;">:</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">{},</span></span>
<span class="line"><span style="color:#A6ACCD;">        children</span><span style="color:#89DDFF;">:</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">[</span><span style="color:#89DDFF;">&quot;</span><span style="color:#C3E88D;">hello world!</span><span style="color:#89DDFF;">&quot;</span><span style="color:#89DDFF;">]</span></span>
<span class="line"><span style="color:#A6ACCD;">    </span><span style="color:#89DDFF;">}]</span></span>
<span class="line"><span style="color:#89DDFF;">}</span></span>
<span class="line"></span></code></pre></div><p>\u5176\u4E2D\u5BF9\u4E8E\u4E00\u4E2A\u8282\u70B9\u5FC5\u5907\u7684\u4E09\u4E2A\u5C5E\u6027 <code>tag\uFF0Cprops\uFF0Cchildren</code></p><ul><li>tag \u6307\u5B9A\u5143\u7D20\u7684<strong>\u6807\u7B7E</strong>\u7C7B\u578B\uFF0C\u5982\u201C<code>li</code>\uFF0C<code>div</code>\u201D</li><li>props \u6307\u5B9A\u5143\u7D20\u8EAB\u4E0A\u7684\u5C5E\u6027\uFF0C\u5982 <code>class</code> \uFF0C<code>style</code>\uFF0C\u81EA\u5B9A\u4E49\u5C5E\u6027</li><li>children \u6307\u5B9A\u5143\u7D20\u662F\u5426\u6709<strong>\u5B50\u8282\u70B9</strong>\uFF0C\u53C2\u6570\u4EE5<strong>\u6570\u7EC4</strong>\u5F62\u5F0F\u4F20\u5165</li></ul><p>\u800C\u6211\u4EEC\u5728 render \u4E2D\u7F16\u5199\u7684 JSX \u4EE3\u7801\u5C31\u662F\u4E00\u79CD\u865A\u62DF DOM \u7ED3\u6784\u3002</p><h2 id="\u4EC0\u4E48\u662F-diff-\u7B97\u6CD5\uFF1F" tabindex="-1">\u4EC0\u4E48\u662F diff \u7B97\u6CD5\uFF1F <a class="header-anchor" href="#\u4EC0\u4E48\u662F-diff-\u7B97\u6CD5\uFF1F" aria-hidden="true">#</a></h2><p>\u5176\u5B9E\u521A\u5F00\u59CB\u5B66\u4E60 React \u7684\u65F6\u5019\uFF0C\u5F88\u591A\u4EBA\u53EF\u80FD\u90FD\u542C\u8BF4\u8FC7 React \u5F88\u9AD8\u6548\uFF0C\u6027\u80FD\u5F88\u597D\u8FD9\u7C7B\u7684\u8BDD\u8BED\uFF0C\u8FD9\u5176\u5B9E\u5C31\u662F\u5F97\u76CA\u4E8E diff \u7B97\u6CD5\u548C Virturl DOM \u7684\u5B8C\u7F8E\u7ED3\u5408\u3002</p><p>\u5355\u7EAF\u7684\u6211\u521A\u5F00\u59CB\u4F1A\u8BA4\u4E3A</p><blockquote><p>React \u4E5F\u53EA\u4E0D\u8FC7\u662F\u5F15\u5165\u4E86\u522B\u4EBA\u7684 diff \u7B97\u6CD5\u800C\u5DF2\uFF0C\u80FD\u6709\u591A\u5389\u5BB3\uFF0C\u53C8\u4E0D\u662F\u539F\u521B \uFF1F</p></blockquote><p>\u4F46\u5F53\u6211\u67E5\u9605\u4E86\u4F17\u591A\u8D44\u6599\u540E\uFF0C\u53D1\u73B0\u88AB\u63D0\u53CA\u6700\u591A\u7684\u662F\u4E00\u4E2A \u201C\u4F20\u7EDF diff \u7B97\u6CD5\u201D</p><p>\u5176\u5B9E React \u9488\u5BF9 diff \u7B97\u6CD5\u505A\u51FA\u7684\u4F18\u5316\uFF0C\u624D\u662F\u6211\u4EEC\u5E94\u5F53\u5B66\u4E60\u7684</p><p>React \u5C06\u539F\u5148\u65F6\u95F4\u590D\u6742\u5EA6\u4E3A O($n^3$) \u7684\u4F20\u7EDF\u7B97\u6CD5\uFF0C\u4F18\u5316\u5230\u4E86 O(n)</p><p><strong>\u5927\u81F4\u6267\u884C\u8FC7\u7A0B\u56FE</strong></p><p><img src="https://ljcimg.oss-cn-beijing.aliyuncs.com/img/image-20210824173128172.png" alt="image-20210824173128172"></p><p>\u90A3 React \u662F\u5982\u4F55\u5B9E\u73B0\u7684\u5462\uFF1F</p><h2 id="\u4E09\u4E2A\u7B56\u7565" tabindex="-1">\u4E09\u4E2A\u7B56\u7565 <a class="header-anchor" href="#\u4E09\u4E2A\u7B56\u7565" aria-hidden="true">#</a></h2><p>\u4E3A\u4E86\u5C06\u590D\u6742\u5EA6\u964D\u5230 O(n)\uFF0CReact \u57FA\u4E8E\u8FD9\u4E09\u4E2A\u7B56\u7565\u8FDB\u884C\u4E86\u7B97\u6CD5\u4F18\u5316</p><ol><li>Web UI \u4E2D DOM \u8282\u70B9\u8DE8\u5C42\u7EA7\u7684<strong>\u79FB\u52A8\u64CD\u4F5C\u7279\u522B\u5C11</strong>\uFF0C\u53EF\u4EE5\u5FFD\u7565\u4E0D\u8BA1\u3002</li><li>\u62E5\u6709\u76F8\u540C\u7C7B\u7684\u4E24\u4E2A\u7EC4\u4EF6\u5C06\u4F1A\u751F\u6210<strong>\u76F8\u4F3C</strong>\u7684\u6811\u5F62\u7ED3\u6784\uFF0C\u62E5\u6709\u4E0D\u540C\u7C7B\u7684\u4E24\u4E2A\u7EC4\u4EF6\u5C06\u4F1A\u751F\u6210<strong>\u4E0D\u540C</strong>\u7684\u6811\u5F62\u7ED3\u6784\u3002</li><li>\u5BF9\u4E8E\u540C\u4E00\u5C42\u7EA7\u7684\u4E00\u7EC4\u5B50\u8282\u70B9\uFF0C\u5B83\u4EEC\u53EF\u4EE5\u901A\u8FC7\u552F\u4E00 id \u8FDB\u884C\u533A\u5206\u3002</li></ol><p>\u9488\u5BF9\u8FD9\u4E09\u4E2A\u7B56\u7565\uFF0CReact \u5206\u522B\u5BF9 <code>tree diff</code>\u3001<code>component diff</code> \u4EE5\u53CA <code>element diff</code> \u8FDB\u884C\u7B97\u6CD5\u4F18\u5316</p><h3 id="tree-diff-\u5206\u5C42\u6C42\u5F02" tabindex="-1">tree diff \u5206\u5C42\u6C42\u5F02 <a class="header-anchor" href="#tree-diff-\u5206\u5C42\u6C42\u5F02" aria-hidden="true">#</a></h3><p>\u9996\u5148\u4F1A\u5C06\u65B0\u65E7\u4E24\u4E2A DOM \u6811\uFF0C\u8FDB\u884C\u6BD4\u8F83\uFF0C\u8FD9\u4E2A\u6BD4\u8F83\u6307\u7684\u662F\u5206\u5C42\u6BD4\u8F83\u3002\u53C8\u7531\u4E8E DOM \u8282\u70B9\u8DE8\u5C42\u7EA7\u7684\u79FB\u52A8\u64CD\u4F5C\u5F88\u5C11\uFF0C\u5FFD\u7565\u4E0D\u8BA1\u3002React \u901A\u8FC7 updataDepth \u5BF9 \u865A\u62DF DOM \u6811\u8FDB\u884C\u5C42\u7EA7\u63A7\u5236\uFF0C\u53EA\u4F1A\u5BF9\u540C\u5C42\u8282\u70B9\u8FDB\u884C\u6BD4\u8F83\uFF0C\u4E5F\u5C31\u662F\u56FE\u4E2D\u53EA\u4F1A\u5BF9\u76F8\u540C\u989C\u8272\u65B9\u6846\u5185\u7684 DOM \u8282\u70B9\u8FDB\u884C\u6BD4\u8F83\u3002\u4F8B\u5982\uFF1A</p><p>\u5F53\u5BF9\u6BD4\u53D1\u73B0\u8282\u70B9\u6D88\u5931\u65F6\uFF0C\u5219\u8BE5\u8282\u70B9\u53CA\u5176\u5B50\u8282\u70B9\u90FD\u4F1A\u88AB\u5B8C\u5168\u5220\u9664\uFF0C\u4E0D\u4F1A\u8FDB\u884C\u66F4\u6DF1\u5C42\u6B21\u7684\u6BD4\u8F83\uFF0C\u8FD9\u6837\u53EA\u9700\u8981\u5BF9\u6811\u8FDB\u884C\u4E00\u6B21\u904D\u5386\uFF0C\u4FBF\u80FD\u5B8C\u6210\u6574\u9897 DOM \u6811\u7684\u6BD4\u8F83</p><p><img src="https://ljcimg.oss-cn-beijing.aliyuncs.com/img/image-20210824131810813.png" alt="image-20210824131810813"></p><p>\u8FD9\u91CC\u8FD8\u6709\u4E00\u4E2A\u503C\u5F97\u5173\u6CE8\u7684\u5730\u65B9\uFF1A<strong>DOM \u8282\u70B9\u8DE8\u5C42\u7EA7\u79FB\u52A8</strong></p><p>\u4E3A\u4EC0\u4E48\u4F1A\u63D0\u51FA\u8FD9\u6837\u7684\u95EE\u9898\u5462\uFF0C\u5728\u4E0A\u9762\u7684\u5220\u9664\u539F\u5219\u4E2D\uFF0C\u6211\u4EEC\u53D1\u73B0\u5F53\u8282\u70B9\u4E0D\u5B58\u5728\u4E86\u5C31\u4F1A\u5220\u9664\uFF0C\u90A3\u6211\u53EA\u662F\u7ED9\u5B83\u6362\u4F4D\u4E86\uFF0C\u5B83\u4E5F\u4F1A\u5220\u9664\u6574\u4E2A\u8282\u70B9\u53CA\u5176\u5B50\u8282\u70B9\u5417\uFF1F</p><p><img src="https://ljcimg.oss-cn-beijing.aliyuncs.com/img/image-20210824155347956.png" alt="image-20210824155347956"></p><p>\u5982\u56FE\uFF0C\u6211\u4EEC\u9700\u8981\u5B9E\u73B0\u8FD9\u6837\u7684\u79FB\u52A8\uFF0C\u4F60\u53EF\u80FD\u4F1A\u4EE5\u4E3A\u5B83\u4F1A\u76F4\u63A5\u8FD9\u6837\u79FB\u52A8</p><p><img src="https://ljcimg.oss-cn-beijing.aliyuncs.com/img/%E7%AD%96%E7%95%A51.gif" alt="\u7B56\u75651"></p><p>\u4F46\u662F\u5B9E\u9645\u60C5\u51B5\uFF0C\u5E76\u4E0D\u662F\u8FD9\u6837\u7684\u3002\u7531\u4E8E React \u53EA\u4F1A\u7B80\u5355\u7684\u8FDB\u884C\u540C\u5C42\u7EA7\u8282\u70B9\u4F4D\u7F6E\u53D8\u5316\uFF0C\u5BF9\u4E8E\u4E0D\u540C\u5C42\u7EA7\u7684\u8282\u70B9\uFF0C\u53EA\u6709\u521B\u5EFA\u548C\u5220\u9664\u64CD\u4F5C\uFF0C\u5F53\u53D1\u73B0 B \u8282\u70B9\u6D88\u5931\u65F6\uFF0C\u5C31\u4F1A\u9500\u6BC1 B\uFF0C\u5F53\u53D1\u73B0 C \u8282\u70B9\u4E0A\u591A\u4E86 B \u8282\u70B9\uFF0C\u5C31\u4F1A\u521B\u5EFA B \u4EE5\u53CA\u5B83\u7684\u5B50\u8282\u70B9\u3002</p><p>\u56E0\u6B64\u8FD9\u6837\u4F1A\u975E\u5E38\u7684\u590D\u6742\uFF0C\u6240\u4EE5 React \u5B98\u65B9\u5E76\u4E0D\u5EFA\u8BAE\u6211\u4EEC\u8FDB\u884C DOM \u8282\u70B9\u8DE8\u7EA7\u64CD\u4F5C</p><h3 id="component-diff" tabindex="-1">component diff <a class="header-anchor" href="#component-diff" aria-hidden="true">#</a></h3><p>\u5728\u7EC4\u4EF6\u5C42\u9762\u4E0A\uFF0C\u4E5F\u8FDB\u884C\u4E86\u4F18\u5316</p><ul><li>\u5982\u679C\u662F\u540C\u4E00\u7C7B\u578B\u7684\u7EC4\u4EF6\uFF0C\u5219\u6309\u7167\u539F\u7B56\u7565\u7EE7\u7EED\u6BD4\u8F83 \u865A\u62DF DOM tree</li><li>\u5982\u679C\u4E0D\u662F\uFF0C\u5219\u5C06\u8FD9\u4E2A\u7EC4\u4EF6\u8BB0\u4E3A <code>dirty component</code> \uFF0C\u4ECE\u800C\u66FF\u6362\u6574\u4E2A\u7EC4\u4EF6\u4E0B\u7684\u6240\u6709\u5B50\u8282\u70B9</li></ul><p>\u540C\u65F6\u5BF9\u4E8E\u540C\u4E00\u7C7B\u578B\u7684\u7EC4\u4EF6\uFF0C\u6709\u53EF\u80FD\u5176 <code>Virtual DOM</code> \u6CA1\u6709\u4EFB\u4F55\u53D8\u5316\uFF0C\u5982\u679C\u80FD\u591F\u786E\u5207\u7684\u77E5\u9053\u8FD9\u70B9\u5C31\u53EF\u4EE5\u8282\u7701\u5927\u91CF\u7684 <code>diff</code> \u8FD0\u7B97\u7684\u65F6\u95F4\uFF0C\u56E0\u6B64 <code>React</code> \u5141\u8BB8\u7528\u6237\u901A\u8FC7 <code>shouldComponentUpdate()</code> \u5224\u65AD\u8BE5\u7EC4\u4EF6\u662F\u5426\u9700\u8981\u8FDB\u884C <code>diff</code> \u7B97\u6CD5\u5206\u6790</p><p>\u603B\u7684\u6765\u8BF4\uFF0C\u5982\u679C\u4E24\u4E2A\u7EC4\u4EF6\u7ED3\u6784\u76F8\u4F3C\uFF0C\u4F46\u88AB\u8BA4\u5B9A\u4E3A\u4E86\u4E0D\u540C\u7C7B\u578B\u7684\u7EC4\u4EF6\uFF0C\u5219\u4E0D\u4F1A\u6BD4\u8F83\u4E8C\u8005\u7684\u7ED3\u6784\uFF0C\u800C\u662F\u76F4\u63A5\u5220\u9664</p><h3 id="element-diff" tabindex="-1">element diff <a class="header-anchor" href="#element-diff" aria-hidden="true">#</a></h3><p>element diff \u662F\u4E13\u95E8\u9488\u5BF9\u540C\u4E00\u5C42\u7EA7\u7684\u6240\u6709\u8282\u70B9\u7684\u7B56\u7565\u3002\u5F53\u8282\u70B9\u5728\u540C\u4E00\u5C42\u7EA7\u65F6\uFF0Cdiff \u63D0\u4F9B\u4E86 3\u4E2A\u8282\u70B9\u64CD\u4F5C\u65B9\u6CD5\uFF1A\u63D2\u5165\uFF0C\u79FB\u52A8\uFF0C\u5220\u9664</p><p>\u5F53\u6211\u4EEC\u8981\u5B8C\u6210\u5982\u56FE\u6240\u793A\u64CD\u4F5C\u8F6C\u5316\u65F6\uFF0C\u4F1A\u6709\u5F88\u5927\u7684\u56F0\u96BE\uFF0C\u56E0\u4E3A\u5728\u65B0\u8001\u8282\u70B9\u6BD4\u8F83\u7684\u8FC7\u7A0B\u4E2D\uFF0C\u53D1\u73B0\u6BCF\u4E2A\u8282\u70B9\u90FD\u8981<strong>\u5220\u9664\u518D\u91CD\u65B0\u521B\u5EFA</strong>\uFF0C\u4F46\u662F\u8FD9\u53EA\u662F\u91CD\u65B0\u6392\u5E8F\u4E86\u800C\u5DF2\uFF0C\u5BF9\u6027\u80FD\u6781\u5927\u7684\u4E0D\u53CB\u597D\u3002\u56E0\u6B64 React \u4E2D\u63D0\u51FA\u4E86\u4F18\u5316\u7B56\u7565\uFF1A</p><p>\u5141\u8BB8\u6DFB\u52A0<strong>\u552F\u4E00\u503C key \u6765\u533A\u5206\u8282\u70B9</strong></p><p><img src="https://ljcimg.oss-cn-beijing.aliyuncs.com/img/image-20210824163240354.png" alt="image-20210824163240354"></p><p>\u5F15\u5165 key \u7684\u4F18\u5316\u7B56\u7565\uFF0C\u8BA9\u6027\u80FD\u4E0A\u6709\u4E86\u7FFB\u5929\u8986\u5730\u7684\u53D8\u5316</p><p><strong>\u90A3 key \u6709\u4EC0\u4E48\u4F5C\u7528\u5462\uFF1F</strong></p><p>\u5F53\u540C\u4E00\u5C42\u7EA7\u7684\u8282\u70B9\u6DFB\u52A0\u4E86 key \u5C5E\u6027\u540E\uFF0C\u5F53\u4F4D\u7F6E\u53D1\u751F\u53D8\u5316\u65F6\u3002react diff \u8FDB\u884C\u65B0\u65E7\u8282\u70B9\u6BD4\u8F83\uFF0C\u5982\u679C\u53D1\u73B0\u6709\u76F8\u540C\u7684 key \u5C31\u4F1A\u8FDB\u884C\u79FB\u52A8\u64CD\u4F5C\uFF0C\u800C\u4E0D\u4F1A\u5220\u9664\u518D\u521B\u5EFA</p><p><strong>\u90A3 key \u5177\u4F53\u662F\u5982\u4F55\u8D77\u4F5C\u7528\u7684\u5462\uFF1F</strong></p><p>\u9996\u5148\u5728 React \u4E2D\u53EA\u5141\u8BB8<strong>\u8282\u70B9\u53F3\u79FB</strong></p><p>\u56E0\u6B64\u5BF9\u4E8E\u4E0A\u56FE\u4E2D\u7684\u8F6C\u5316\uFF0C\u53EA\u4F1A\u8FDB\u884C A\uFF0CC \u7684\u79FB\u52A8</p><p>\u5219\u53EA\u9700\u8981\u5BF9\u79FB\u52A8\u7684\u8282\u70B9\u8FDB\u884C\u66F4\u65B0\u6E32\u67D3\uFF0C\u4E0D\u79FB\u52A8\u7684\u5219\u4E0D\u9700\u8981\u66F4\u65B0\u6E32\u67D3</p><p><strong>\u4E3A\u4EC0\u4E48\u4E0D\u80FD\u7528 index \u4F5C\u4E3A key \u503C\u5462\uFF1F</strong></p><p><code>index</code> \u4F5C\u4E3A <code>key</code> \uFF0C\u5982\u679C\u6211\u4EEC\u5220\u9664\u4E86\u4E00\u4E2A\u8282\u70B9\uFF0C\u90A3\u4E48\u6570\u7EC4\u7684\u540E\u4E00\u9879\u53EF\u80FD\u4F1A\u524D\u79FB\uFF0C\u8FD9\u4E2A\u65F6\u5019\u79FB\u52A8\u7684\u8282\u70B9\u548C\u5220\u9664\u7684\u8282\u70B9\u5C31\u662F\u76F8\u540C\u7684 <code>key</code> \uFF0C\u5728<code>react</code>\u4E2D\uFF0C\u5982\u679C <code>key</code> \u76F8\u540C\uFF0C\u5C31\u4F1A\u89C6\u4E3A<strong>\u76F8\u540C\u7684\u7EC4\u4EF6</strong>\uFF0C\u4F46\u8FD9\u4E24\u4E2A\u7EC4\u4EF6\u662F\u4E0D\u540C\u7684\uFF0C\u8FD9\u6837\u5C31\u4F1A\u51FA\u73B0\u5F88\u9EBB\u70E6\u7684\u4E8B\u60C5\uFF0C\u4F8B\u5982\uFF1A\u5E8F\u53F7\u548C\u6587\u672C\u4E0D\u5BF9\u5E94\u7B49\u95EE\u9898</p><p>\u6240\u4EE5\u4E00\u5B9A\u8981\u4FDD\u8BC1 <code>key</code> \u7684\u552F\u4E00\u6027</p><h2 id="\u5EFA\u8BAE" tabindex="-1">\u5EFA\u8BAE <a class="header-anchor" href="#\u5EFA\u8BAE" aria-hidden="true">#</a></h2><p>React \u5DF2\u7ECF\u5E2E\u6211\u4EEC\u505A\u4E86\u5F88\u591A\u4E86\uFF0C\u5269\u4E0B\u7684\u9700\u8981\u6211\u4EEC\u591A\u52A0\u6CE8\u610F\uFF0C\u624D\u80FD\u6709\u66F4\u597D\u7684\u6027\u80FD</p><p>\u57FA\u4E8E\u4E09\u4E2A\u7B56\u7565\u6211\u4EEC\u9700\u8981\u6CE8\u610F</p><p><strong>tree diff \u5EFA\u8BAE</strong>\uFF1A\u5F00\u53D1\u7EC4\u4EF6\u65F6\uFF0C\u9700\u8981\u6CE8\u610F\u4FDD\u6301 DOM \u7ED3\u6784\u7A33\u5B9A</p><p><strong>component diff \u5EFA\u8BAE</strong>\uFF1A\u4F7F\u7528 <code>shouldComponentUpdate()</code> \u6765\u51CF\u5C11\u4E0D\u8981\u7684\u66F4\u65B0</p><p><strong>element diff \u5EFA\u8BAE</strong>\uFF1A\u51CF\u5C11\u6700\u540E\u4E00\u4E2A\u8282\u70B9\u79FB\u52A8\u5230\u5934\u90E8\u7684\u64CD\u4F5C\uFF0C\u8FD9\u6837\u524D\u9762\u7684\u8282\u70B9\u90FD\u9700\u8981\u79FB\u52A8</p><h2 id="\u53C2\u8003\u8D44\u6599" tabindex="-1">\u53C2\u8003\u8D44\u6599 <a class="header-anchor" href="#\u53C2\u8003\u8D44\u6599" aria-hidden="true">#</a></h2><p><a href="https://segmentfault.com/a/1190000016539430" target="_blank" rel="noopener noreferrer">\u8C08\u8C08React\u4E2DDiff\u7B97\u6CD5\u7684\u7B56\u7565\u53CA\u5B9E\u73B0</a></p><p><a href="https://segmentfault.com/a/1190000011492275" target="_blank" rel="noopener noreferrer">React diff\u7B97\u6CD5</a></p><p><a href="https://juejin.cn/post/6967626390380216334#heading-1" target="_blank" rel="noopener noreferrer">\u6D45\u8C08react \u865A\u62DFdom\uFF0Cdiff\u7B97\u6CD5\u4E0Ekey\u673A\u5236</a></p><hr><p>\u5173\u4E8E\u624B\u5199\u5B9E\u73B0 diff \u7B97\u6CD5\uFF0C\u8FD8\u6709\u70B9\u96BE\u5EA6\uFF0C\u8FD9\u4E8B\u7B49\u5B66\u5B8C React \u540E\u518D\u8BF4\u5427</p><blockquote><p>\u975E\u5E38\u611F\u8C22\u60A8\u7684\u9605\u8BFB\uFF0C\u6B22\u8FCE\u63D0\u51FA\u4F60\u7684\u610F\u89C1\uFF0C\u6709\u4EC0\u4E48\u95EE\u9898\u6B22\u8FCE\u6307\u51FA\uFF0C\u8C22\u8C22\uFF01\u{1F388}</p></blockquote>`,71),t=[p];function l(c,r,i,d,f,D){return a(),s("div",null,t)}var h=e(o,[["render",l]]);export{y as __pageData,h as default};
